                className="headerImage2"
                src="https://images.unsplash.com/photo-1510442650500-93217e634e4c?ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&ixlib=rb-1.2.1&auto=format&fit=crop&w=637&q=80"
            />
        </div>
    );
}

